function FetchDataa() {

    const [backendData, setBackendData] = useState(({}))

    const handleFetch = () => {
        fetch('http://localhost:4000/stories')           //api for the get request
        .then(response => response.json())
        .then(data => {
            setBackendData(data)
        }); 
    }


  return (
    <div>
        <button onClick={handleFetch}>Fetch Story</button>
    </div>
  )
}

